import React from "react";
import User from "./user";

class Users extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      users: [
        {
          id: 1,
          firstname: "Bob",
          lastname: "Marley",
          bio: "when abused becomes the abuser when abused becomes the abuser when abused becomes the abuser when abused becomes the abuser",
          age: 40,
          isHappy: true,
        },
        {
          id: 2,
          firstname: "Jonh",
          lastname: "Doe",
          bio: "I don't take it for granted",
          age: 22,
          isHappy: false,
        },
      ],
    };
  }
  render() {
    if (this.state.users.length > 0)
      return (
        <div>
          {this.state.users.map((el) => (
            <User key={el.id} user={el} />
          ))}
        </div>
      );
    else
      return (
        <div className="user">
          <h3>there're no users</h3>
        </div>
      );
  }
}

export default Users;
